//缓存初始化
HMUI.MobileCache.CacheInit = function () {
    var systemType = HMUI.Window.GetSystemType();
    if (systemType == "android") {
        if (typeof bridge !== "undefined")
            bridge.cacheInit();
    }
    else if (systemType == "iPhone" || systemType == "iPad") {
        if (typeof bridge !== "undefined")
            window.bridge.cacheInit();
    }
    else if (systemType == "pc") {
        //TODO:添加缓存
    }
};

//设置缓存项
HMUI.MobileCache.SetData = function (key, value, type) {
    var systemType = HMUI.Window.GetSystemType();
    if (systemType == "android") {
        if (typeof bridge !== "undefined")
            bridge.setData(key, value, type, HMUI.AppSets.IISStartTime);
    }
    else if (systemType == "iPhone" || systemType == "iPad") {
        if (typeof bridge !== "undefined")
            window.bridge.setDataValueTypeStartTime(key, value, type, HMUI.AppSets.IISStartTime);
    }
    else if (systemType == "pc") {
        //TODO:添加缓存
        var newCache = {
            key: key,
            value: value,
            type: type
        };
        HMUI.JSCache[key] = newCache;
    }
};
//获取缓存项
HMUI.MobileCache.GetData = function (key, type) {
    var ret = null;
    var systemType = HMUI.Window.GetSystemType();
    if (systemType == "android") {
        if (typeof bridge !== "undefined")
            ret = bridge.getData(key, type, HMUI.AppSets.IISStartTime);
    }
    else if (systemType == "iPhone" || systemType == "iPad") {
        if (typeof bridge !== "undefined")
            ret = window.bridge.getDataTypeStartTime(key, type, HMUI.AppSets.IISStartTime);
    }
    else if (systemType == "pc") {
        //TODO:添加缓存
        if (HMUI.JSCache[key]) {
            ret = HMUI.JSCache[key].value;
        }
    }
    return ret;
};
//清空缓存
HMUI.MobileCache.ClearData = function () {
    var systemType = HMUI.Window.GetSystemType();
    if (systemType == "android") {
        if (typeof bridge !== "undefined")
            bridge.clearData();
    }
    else if (systemType == "iPhone" || systemType == "iPad") {
        if (typeof bridge !== "undefined")
            window.bridge.clearData();
    }
    else if (systemType == "pc") {
        //TODO:添加缓存
    }
};